import { TableRow, TableCell } from "@material-ui/core";
import { Book } from "./book";




export interface BookTableRowProps {
    book: Book;
    isLoggedIn: boolean;
  }

  export function BookTableRow({ book, isLoggedIn }: BookTableRowProps) {
    const { book_name, author, copies, is_available } = book;

    return (
      <TableRow>
        <TableCell>{book_name}</TableCell>
        <TableCell>{author}</TableCell>
        {isLoggedIn && <TableCell>{copies}</TableCell>}
        <TableCell>{is_available ? "Available" : "Not available"}</TableCell>
      </TableRow>
    );
  }
